import {
  SlVisuallyHidden
} from "./chunk.3N7QX4PF.js";

// src/react/visually-hidden/index.ts
import * as React from "react";
import { createComponent } from "@lit/react";
var tagName = "sl-visually-hidden";
SlVisuallyHidden.define("sl-visually-hidden");
var reactWrapper = createComponent({
  tagName,
  elementClass: SlVisuallyHidden,
  react: React,
  events: {},
  displayName: "SlVisuallyHidden"
});
var visually_hidden_default = reactWrapper;

export {
  visually_hidden_default
};
